	document.write('<td class="tdContentBorderRight tdContentC">'+MaxRate+'</td>');
	document.write('<td class="tdContentBorderRight tdContentC">'+Enabled+'</td>');
	document.write('<td class="tdContentBorderRight tdContentC"><a href="javascript: editEntry('+Edit+')"><img src=images/edit.gif width=20 height=16 border=0 title="Edit"></a></td>');			
	
	document.write('<td class="tdContentC">');
	document.write('<img border="0" src="images/_blank.gif" width="10" height="1">');

	document.write('</tr>');
}
